(97, 3408074, '配料表', '原料组成：三文鱼肉25%、三文鱼粉22%、鳀鱼粉21%、马铃薯粉、红薯粉、鸡油、啤酒酵母粉、亚麻籽油3%、鱼油1%、红薯粉、胡萝卜粉、番茄、燕麦草、魔芋粉、蔓越莓0.5%、苹果、金银花、薏苡仁、核桃仁、丝兰粉。\n添加剂组成：牛磺酸、L-肉碱、DL-蛋氨酸、L-赖氨酸、蛋黄卵磷脂0.2%、果寡糖0.2%、维生素A、维生素C、维生素D3、维生素E、维生素B1、维生素B2、维生素B6、维生素B12、D-生物素、烟酸、D-泛酸钙、叶酸、氨基酸铜络合物、氨基酸铁络合物、氨基酸锰络合物、氨基酸锌络合物。', '2023-02-17 08:10:36', '2023-02-17 08:10:36'),
(98, 3408074, '营养分析保证值', '粗蛋白质≥36%；粗脂肪≥16%；粗纤维≤3.0%；粗灰分≤10%；水分≤10%；钙≥1.2%；总磷≥1.0%；水溶性氯化物（以Cl-计）≥0.3%；牛磺酸≥0.28%；Omega-3脂肪酸≥0.5%；Omega-6脂肪酸≥2.5%；二十碳五烯酸（EPA）≥0.15%；二十二碳六烯酸（DHA）≥0.2%；代谢能373Kcal/100g。', '2023-02-17 08:10:36', '2023-02-17 08:10:36'),
(99, 3408074, '贮存条件', '请于阴凉干燥处保存，为保持良好的风味和新鲜度，开袋后请及时封口。如发现霉变等异常现象，请勿喂食。', '2023-02-17 08:10:36', '2023-02-17 08:10:36'),
(100, 3408074, '温馨提示', '1.为了您爱宠的肠胃健康，请根据换粮提示科学换粮。2.产品包装无需使用其他工具，请按照包装提示撕开包装密封条。使用刀剪可能会破坏密封条结构导致密封条失效。3.大规格商品建议放入储量桶内存放。4.第一次试粮，建议购买小规格商品进行尝试换粮。', '2023-02-17 08:10:36', '2023-02-17 08:10:36'),
