(106, 1564054, '使用注意事项', '1.易碎物品，小心轻放。\n2.盛放热水等热源食物后避免烫伤。\n3.使用后请及时清洗，仅可手洗；请勿使用钢丝球等锐利洁具清洗。\n4.如遇顽固茶渍、污垢，可先用少许热水浸泡，再用湿纸巾、毛巾等擦拭。\n5.本品不可用于微波炉、烤箱中，但请勿置于冰箱冷冻室（或极冷、极热交替）。', '2023-02-17 08:23:30', '2023-02-17 08:23:30'),
