(114, 1146000, '关于TDS', '1、TDS（TotalDissolvedSolids)，指溶解性固体重量，主要反映水中钙、镁、钠、钾等导电离子含量和其他固体，基本只适用于测试纯水或纯水机好坏，并不适用于其他种类的净水设备。\n2、网易严选镁离子净水壶，采用欧洲发明专利技术，净水之余能保留水中有益矿物质，同时会置换镁离子于水中改进口感，让饮水更健康。\n3、TDS检测不适用于镁离子净水壶/滤芯。', '2023-02-17 08:24:07', '2023-02-17 08:24:07'),
